syntax = "proto2";

package carIQ.protobuf.fuel;

import "google/protobuf/timestamp.proto";

// -----------------------------------------------------------------------------
// Services
// -----------------------------------------------------------------------------

service FuelServer {
  rpc ListStations (ListStationsRequest) returns (ListStationsResponse);

  rpc GetTransaction(GetTransactionRequest) returns (GetTransactionResponse);

  rpc ListTransactions (ListTransactionsRequest) returns (ListTransactionsResponse);

  rpc AuthorizePump (AuthorizePumpRequest) returns (AuthorizePumpResponse);
}

// -----------------------------------------------------------------------------
// Messages
// -----------------------------------------------------------------------------

message ListStationsRequest {
  optional string request_id = 1;
  required PageRequest page = 2;
  optional string vehicle_id = 3;
  optional Location location = 4;
  optional double radius = 5;
}

message ListStationsResponse {
  required string request_id = 1;
  required StationPage page = 2;
}

message ListTransactionsRequest {
  optional string request_id = 1;
  required string vehicle_id = 2;
  required PageRequest page = 3;
  optional bool include_statuses = 4 [default = false];
}

message GetTransactionRequest {
  required string request_id = 1;
  required string transaction_id = 2;
}

message GetTransactionResponse {
  required string request_id = 1;
  required Transaction transaction = 2;
}

message ListTransactionsResponse {
  required string request_id = 1;
  required TransactionPage page = 2;
}

message AuthorizePumpRequest {
  optional string request_id = 1;
  required string vehicle_id = 2;
  required string station_id = 3;
  required uint32 pump_number = 4;
  optional Location location = 5;
  optional string device_id = 6;
  optional DeviceIDType device_id_type = 7;
  optional string user_id = 8;

  enum DeviceIDType {
    UNKNOWN = 0;
    UUID = 1;
    ESN = 2;
    IMEI = 3;
  }
}

message AuthorizePumpResponse {
  required string request_id = 1;
  required string transaction_id = 2;
}

message PageRequest {
  optional uint32 limit = 1 [default = 100];
  optional uint64 offset = 2 [default = 0];
}

// -----------------------------------------------------------------------------
// Resources
// -----------------------------------------------------------------------------

message StationPage {
  repeated Station data = 1;
  required PageMeta meta = 2;
}

message TransactionPage {
  repeated Transaction data = 1;
  required PageMeta meta = 2;
}

message Station {
  required string id = 1;
  optional string external_id = 2;
  optional string integration_provider_id = 3;
  optional string name = 4;
  optional Address address = 5;
  repeated uint32 pumps = 6;
  optional Location location = 7;
  optional Geobounds geobounds = 8;
}

message Transaction {
  required string id = 1;
  optional string external_id = 2;
  optional string integration_provider_id = 3;
  optional string device_id = 4;
  optional string device_id_type = 5;
  optional string vehicle_id = 6;
  optional Location location = 7;
  repeated TransactionStatus statuses = 8;
  optional uint32 pump_number = 9;
  optional string currency = 10;
  optional string tax_amount = 11;
  optional string total_amount = 12;
  optional string total_quantity = 13;
  optional string units = 14;
  optional string station_id = 15;
  optional Address address = 16;
  optional google.protobuf.Timestamp service_time = 17;
  optional google.protobuf.Timestamp inserted_at = 18;
  optional google.protobuf.Timestamp updated_at = 19;
  optional string meta = 20;
}

message TransactionStatus {
  required string transaction_id = 1;
  required string status = 2;
  optional google.protobuf.Timestamp inserted_at = 3;
  optional string meta = 4;
}

message Address {
  optional string street_1 = 1;
  optional string street_2 = 2;
  optional string city = 3;
  optional string state = 4;
  optional string country = 5;
  optional string postal_code = 6;
}

message PageMeta {
  optional uint32 limit = 1;
  optional uint64 offset = 2;
  optional uint64 total = 3;
}

message Location {
  optional double latitude = 1;
  optional double longitude = 2;
}

message Geobounds {
  required string wkt = 1;
  optional double radius = 2;
}

