syntax = "proto3";

package carIQ.organizations;

import "google/protobuf/timestamp.proto";
import "common.proto";

option go_package = "github.com/gocariq/configuration-service/proto;proto";

service OrganizationServer {
  rpc GetOrganization(GetOrganizationRequest)
    returns (GetOrganizationResponse);

  rpc ListOrganizations(ListOrganizationsRequest)
    returns (ListOrganizationsResponse);

  rpc CreateOrganization(CreateOrganizationRequest)
    returns (GetOrganizationResponse);

  rpc GetEntity(GetEntityRequest)
    returns (GetEntityResponse);
}

// -----------------------------------------------------------------------------
// Messages
// -----------------------------------------------------------------------------

message GetOrganizationRequest {
  string id = 1;
}

message GetOrganizationResponse {
  Organization organization = 1;
}

message ListOrganizationsRequest {
  carIQ.common.PageRequest page = 1;
}

message ListOrganizationsResponse {
  carIQ.common.PageMeta meta = 1;
  repeated Organization data = 2;
}

message CreateOrganizationRequest {
  string name = 1;
  string units_id = 2;
  string tax_id = 3;
  carIQ.common.Address address = 4;
  string onboarded_by = 5;
}

message GetEntityRequest {
  string id = 1;
}

message GetEntityResponse {
  Entity entity = 1;
}

// -----------------------------------------------------------------------------
// Resources
// -----------------------------------------------------------------------------

message Organization {
  string id = 1;
  string name = 2;
  string units_id = 3;
  string tax_id = 4;
  carIQ.common.Address address = 5;
  google.protobuf.Timestamp onboarded_at = 6;
  string onboarded_by = 7;
  google.protobuf.Timestamp inserted_at = 8;
  google.protobuf.Timestamp updated_at = 9;
  google.protobuf.Timestamp deleted_at = 10;
}

message Entity {
  string id = 1;
  string name = 2;
  string description = 3;
  string external_id = 4;
  Entity parent = 5;
  Organization organization = 6;
  bool has_finance = 7;
  uint64 code = 8;
  string path = 9;
  repeated MachineGroup machine_groups = 10;
  repeated UserGroup user_groups = 11;
  FundingSource funding = 12;
  google.protobuf.Timestamp inserted_at = 13;
  google.protobuf.Timestamp updated_at = 14;
  google.protobuf.Timestamp deleted_at = 15;
}

message MachineGroup {
  string id = 1;
}

message UserGroup {
  string id = 1;
}

enum FundingSource {
  unknown = 0;
  ach = 1;
  parent = 2;
}
